import React from 'react';
import ar from "../../utils/img/arrow.png";
import cl from "./ManageArrow.module.css"

const ManageArrow = ({pageChoose, setPageChoose, allOpt, callback}) => {



    return (
        <div className={"arrowDiv"}>


            <div className={"textBut"} onClick={() =>
            {
                if (pageChoose!==1) setPageChoose(pageChoose-1)

            }

            }>
                <img src={ar} style={{height: "100%"}} alt={"arrow to next"} />
                Назад
            </div>

            <div className={cl.progress}>
                <div className={pageChoose>=1 ? cl.active : cl.desActive}></div>
                <div className={pageChoose>=2 ? cl.active : cl.desActive}></div>
                <div className={pageChoose>=3 ? cl.active : cl.desActive}></div>
                <div className={pageChoose>=4 ? cl.active : cl.desActive}></div>
                <div className={pageChoose>=5 ? cl.active : cl.desActive}></div>
            </div>

            <div className={"textBut tbLeft"} onClick={() => {
                if (pageChoose < 4) {
                    if (Object.keys(allOpt[pageChoose - 1]).length !== 0 || allOpt[pageChoose - 1].length > 0) {

                        setPageChoose(pageChoose + 1)
                    }
                }
                else{

                    callback()
                }
            }}>Далее
                <div className={"arDiv"}>
                    <img src={ar} style={{rotate: "180deg", height: "100%"}} alt = {"arrow to back"} />
                </div>

            </div>


        </div>
    );
};

export default ManageArrow;
